export default class Descriptions {
  public static ABOUT_ME =
    "My name is Lorenzo. I am a software developer (degree says engineer, but I'm not so sure about that one) " +
    "with a love for all things frontend. I tend to gravitate towards the more outwardly creative corners " +
    "of software because I believe myself to naturally be more creative minded than technical. Before I decided " +
    "to try my hand in software engineering, I originally planned on futher pursuing my love of music until I " +
    "thought it'd be benefically to add just one more skill to my, admittedly small, yet focused repertoire." +
    "";
  public static HOBBIES = "";
}
